import React from "react";
function Bottom(props){
    
    return (
    <div>
       <h4>Accuracy</h4>
       <div class="progress">
       <div class="barOverflow">
            <div class="bar"></div>
                </div>
                <span>{props.accu}</span>%
                </div>

        <h4>Words per minute(WPM) : (props.wpm}</h4>
    </div>
    );
}
export default Bottom;
